// pass the information from one com[ponent to another component
// declare -- {}
// props are immutable -- we cant able to update 

// destructuring -- multines props to make  sinlge ;line props\
// prop-types -- used to validate the data types 
// npm i prop-types

import PropTypes from "prop-types"

function App(props){
    const{name,city,age,state}=props
    return(
        <div>
       <p>
        Name:{name}<br/>
        city:{city}<br/>
        age:{age}<br/>
        state:{state}
       </p>
        </div>
    )
}



export default App;
